  false,\n\t\"url\": null,\n\t\"notes\": \"This narrative report for Bear River Migratory
  Bird Refuge outlines Refuge accomplishments from August through October of 1941.
  The report begins by summarizing the weather conditions and water conditions during
  this period. Wildlife- including waterbirds, upland game birds, furbearers, predators,
  fish, and disease- is also covered. The Refuge development and maintenance section
  discusses physical developments, plantings, and collections and receipts. Resource
  management is outlined; topics include commercial fishing. A progress report on
  field investigations and applied research is also provided. The public relations
  section of the report describes recreational uses, Refuge visitors, hunting, and
  violations.\",\n\t\"owner_org\": \"4d7ad1cd-3641-420b-8116-e4082f49cd44\",\n\t\"extras\":
